--------------------------------------------------------
--  DDL for View DIM_PLAZA_V
--------------------------------------------------------

  CREATE OR REPLACE FORCE EDITIONABLE VIEW "EXAT_DWH"."DIM_PLAZA_V" ("PLAZA_KEY", "PLAZA_CODE", "PLAZA_NAME") AS 
  Select distinct 
  Plaza_Key,
  Plaza_Code,
  Plaza_Name
From Dim_Plaza
where Highway_Code = '99';
--------------------------------------------------------
--  DDL for View EASY_PASS_MEMBER_ACTIVE_V
--------------------------------------------------------

  CREATE OR REPLACE FORCE EDITIONABLE VIEW "EXAT_DWH"."EASY_PASS_MEMBER_ACTIVE_V" ("BUDDHIST_FISCAL_YEAR", "BUDDHIST_SHORT_DATE", "BUDDHIST_DATE", "TYPE", "AMOUNT") AS 
  WITH ACTIVE AS(
  SELECT 
    DD.BUDDHIST_FISCAL_YEAR,
    DD.BUDDHIST_SHORT_DATE,
    DD.BUDDHIST_DATE,
    SUM(NO_OF_TAGHOLDER) AS AMT 
  FROM FACT_EASY_PASS_MEMBER EM
  LEFT JOIN DIM_CUSTOMER_TYPE CT ON CT.CUSTOMER_TYPE_KEY = EM.CUSTOMER_TYPE_KEY
  LEFT JOIN DIM_DATE DD ON DD.DATE_KEY = EM.DATE_KEY
  WHERE CT.CUSTOMER_TYPE_CODE IN('C', 'P')
  GROUP BY DD.BUDDHIST_FISCAL_YEAR, DD.BUDDHIST_SHORT_DATE, DD.BUDDHIST_DATE
),
NONACTIVE AS (
  SELECT
    DD.BUDDHIST_FISCAL_YEAR,
    DD.BUDDHIST_SHORT_DATE,
    DD.BUDDHIST_DATE,
    SUM(FNUT.NO_OF_TAG) AS AMT
  FROM FACT_NON_USAGE_TAG FNUT
  LEFT JOIN DIM_DATE DD ON DD.DATE_KEY = FNUT.DATE_KEY
  LEFT JOIN DIM_NON_USAGE_RANGE DNUR ON DNUR.NON_USAGE_RANGE_KEY = FNUT.NON_USAGE_RANGE_KEY 
  AND DNUR.START_DATE_RANGE > 24
  GROUP BY DD.BUDDHIST_FISCAL_YEAR, DD.BUDDHIST_SHORT_DATE, DD.BUDDHIST_DATE
)
SELECT 
  ACT.BUDDHIST_FISCAL_YEAR,
  ACT.BUDDHIST_SHORT_DATE,
  ACT.BUDDHIST_DATE,
  'Active' AS type,
  (ACT.AMT - NON.AMT) AS AMOUNT
FROM ACTIVE ACT, NONACTIVE NON
WHERE (ACT.BUDDHIST_FISCAL_YEAR = NON.BUDDHIST_FISCAL_YEAR 
  AND ACT.BUDDHIST_SHORT_DATE = NON.BUDDHIST_SHORT_DATE
  And ACT.BUDDHIST_DATE = NON.BUDDHIST_DATE
)
UNION
SELECT 
  NON.BUDDHIST_FISCAL_YEAR,
  NON.BUDDHIST_SHORT_DATE,
  NON.BUDDHIST_DATE,
  'Non Active' AS type,
  NON.AMT AS AMOUNT
FROM NONACTIVE NON
ORDER BY 1, 2, 3;
